import "./App.css";
import Footer from "./Components/Footer";
import Experience from "./Pages/Experience";
import Hero from "./Pages/Hero";
import Projects from "./Pages/Projects";

function App() {
  return (
    <>
      <Hero />
      <Experience />
      <Projects />
      <Footer />
    </>
  );
}

export default App;
